import {
  Home,
  // Partners,

  // Apps,
  // BackendError,
  // Lockscreen,
  // NotFound,
  PasswordReset,
  Signin
  // Signup
} from "./pages";
import { BrowserRouter, Route, Switch } from "react-router-dom";

import AppProvider from "./components/AppProvider/AppProvider";
import Dashboard from "./containers/Dashboard";
import React from "react";
import registerServiceWorker from "./registerServiceWorker";
import { render } from "react-dom";
import { Calendar } from "react-big-calendar";
import Users from "./pages/Users/Users";
import Baskets from "./pages/Baskets/Baskets";
import Partners from "./pages/partners/Partners";
import PartnersUpdate from "./pages/partners/PartnersUpdate";
import Partnersadd from "./pages/partners/Partnersadd";

render(
  <AppProvider>
    <BrowserRouter basename={process.env.PUBLIC_URL}>
      <Switch>
        {/* <Route exact path="/404" component={NotFound} />
        <Route exact path="/500" component={BackendError} /> */}
        {/* <Route exact path="/Lockscreen" component={Lockscreen} /> */}
        <Route exact path="/forgot" component={PasswordReset} />
        <Route exact path="/Home" component={Home} />
        <Route exact path="/Signin" component={Signin} />
        <Route exact path="/Users" component={Users} />
        <Route exact path="/Partners" component={Partners} />
        <Route exact path="/PartnersUpdate" component={PartnersUpdate} />
        <Route exact path="/Partnersadd" component={Partnersadd} />

        <Route exact path="/Baskets" component={Baskets} />

        {/* <Route exact path="/Calendar" component={Calendar} /> */}
        {/* <Route exact path="/signup" component={Signup} /> */}
        <Route path="/" component={Dashboard} />
      </Switch>
    </BrowserRouter>
  </AppProvider>,
  document.getElementById("root")
);

registerServiceWorker();
